import React, { useState } from 'react';
import { maintenanceData } from '../config/MaintenanceData';
import MantenimientoTable from '../componentes/MantenimientoTable';
import '../styles/global.css';

const Mantenimiento = () => {
    const [filteredData, setFilteredData] = useState(maintenanceData);

    const handleSearch = (query) => {
        const lowerCaseQuery = query.toLowerCase();
        const filtered = maintenanceData.filter(
            (maintenance) =>
                maintenance.residente.toLowerCase().includes(lowerCaseQuery) ||
                maintenance.asunto.toLowerCase().includes(lowerCaseQuery) ||
                maintenance.descripcion.toLowerCase().includes(lowerCaseQuery)
        );
        setFilteredData(filtered);
    };

    return (
        <div className="page-container">
            <div className="page-header">
                <h2>Solicitudes de Mantenimiento</h2>
                <button className="action-btn">
                    <i className="fas fa-plus"></i> Nueva Solicitud
                </button>
            </div>
            <MantenimientoTable data={filteredData} />
        </div>
    );
};

export default Mantenimiento;
